- input: "TEXT\x1CC00277541\x1CX0\x1C\x1CF3XA\x1CIn 2009, the Fairfax County Democratic
    Committee enters a year with no federal candidates on the ballot unless a vacancy
    triggers a special federal election. The Committee employs a full time Executive
    Director, whose time is more than 25 percent devoted to federal elections and
    candidates.  No other entity pays compensation for their employees to work for
    the committee. The Committee maintains both Federal and Non Federal accounts.
    Funds in our Non Federal account had been inadequate to transfer to the Federal
    Account for disbursements between October 1, 2008, and January 31, 2009.  Beginning
    with this report, qualified joint administrative expenses are allocated again
    on the15 percent Federal, 85 percent Non Federal split due to no federal elections
    in Virginia during 2009. Expenses qualified as joint administrative expenses in
    this monthly report will result in a transfer from the Non Federal account to
    the Federal account in our next monthly report cycle. The Committee does not engage
    in any fundraising on behalf of candidates for Federal office, so all of its reported
    fundraising expenses are party fundraising. The main purpose of this amendment
    is to align the corrected cumulative balance with the recently amended monthly
    reports for 2008. In addition, certain disbursements have been restated to clarify
    purposes of the expenses or to correct errors in original classifications.\n"
